import React, { Component } from 'react';

class Home extends Component {
    render() {
        return (

                        <div style={{textAlign:"left", color:'red', fontFamily:'monospace'}}>
                <h3 class="text-primary"><strong>Hello there! My name is Tasnim Ali and I am a software developer who designs fullstack web applications. </strong></h3>
                <br />
                <h4 >Have a project or opportunity you'd like to discuss?</h4>
                <p>Let's talk ✉️<a href="mailto:rajonali44492@icloud.com">rajonali44492@icloud.com</a></p>
            </div>
        );
    }
}

export default Home;
